CREATE PROCEDURE [dbo].[ListEventoUsuarioVirtualVideoByEvento]
(
	@IdEvento INT,
	@IdEventoUsuario INT
)
AS

BEGIN DECLARE @IdTipoUsuario INT;
SET @IdTipoUsuario=(SELECT u.IdUsuarioTipo FROM Usuario u WHERE u.IdUsuario=@IdUsuario);
IF(@IdTipoUsuario=1 OR @IdTipoUsuario=2) BEGIN SELECT vv.IdVirtualVideo, vv.IdEvento, vv.Url, CAST(1 AS BIT) MostrarVideo FROM VirtualVideo vv WHERE vv.IdEvento=@IdEvento and vv.Estado=1 END ELSE BEGIN SELECT vv.IdVirtualVideo, vv.IdEvento, vv.Url, (CASE WHEN RECORD.Id IS NOT NULL THEN CAST(1 AS BIT) ELSE CAST(0 AS BIT) END) MostrarVideo FROM VirtualVideo vv LEFT JOIN (SELECT euvv.Id, euvv.IdVirtualVideo FROM EventoUsuario eu INNER JOIN EventoUsuarioVirtualVideo euvv ON eu.IdEventoUsuario=euvv.IdEventoUsuario WHERE eu.Estado=1 AND euvv.Estado=1 AND eu.IdEvento=@IdEvento AND eu.IdUsuario=@IdUsuario) RECORD ON RECORD.IdVirtualVideo=vv.IdVirtualVideo WHERE vv.IdEvento=@IdEvento and vv.Estado=1 END
END

CREATE PROCEDURE [dbo].[ListVirtualVideoByUsuarioByEvento]
(
	@IdEvento INT,
	@IdUsuario INT
)
AS

BEGIN
DECLARE @end INT;
SET @end=(@start+@length);
SELECT RECORD.*, (SELECT COUNT(1) FROM CorreoDifusion WITH(NOLOCK) WHERE IdCorreo=RECORD.IdCorreo) Cantidad FROM ( SELECT COUNT(1) OVER() TotalRegistros, ROW_NUMBER() OVER(ORDER BY p.IdCorreo DESC) AS RowNum, p.IdCorreo, p.Asunto, p.Origen, p.NombreOrigen, p.EstadoCorreo, p.FechaEnvio, p.NumeroEnvio FROM Correo p WITH(NOLOCK) WHERE p.Estado=1 ) RECORD WHERE RECORD.RowNum>@start AND RECORD.RowNum<=@end ORDER BY RECORD.IdCorreo DESC END

CREATE PROCEDURE [dbo].[UspListCorreoPaged]
(
	@search VARCHAR(20),
	@start INT,
	@length INT
)
AS

BEGIN
DECLARE @end INT;
SET @end=(@start+@length);
SELECT RECORD.* FROM ( SELECT COUNT(p.IdModulo) OVER() TotalRegistros, ROW_NUMBER() OVER(ORDER BY p.IdModulo ASC) AS RowNum, p.IdLeccion, p.IdModulo, p.Tipo, t.NombreTipo, p.Nombre, p.Descripcion, p.Duracion FROM Leccion p WITH(NOLOCK) INNER JOIN Tipo t WITH(NOLOCK) ON t.Valor = p.Tipo AND t.Grupo = 'TIPO LECCION' WHERE p.Estado=1 and p.IdModulo=@IdModulo AND ( p.Nombre LIKE ('%' + @search + '%') ) ) RECORD WHERE RECORD.RowNum>@start AND RECORD.RowNum<=@end
END

CREATE PROCEDURE [dbo].[UspListLeccionByModuloPaged]
(
	@IdModulo INT,
	@search VARCHAR(20),
	@start INT,
	@length INT
)
AS

BEGIN
DECLARE @end INT;
SET @end=(@start+@length);
SELECT RECORD.* FROM ( SELECT COUNT(p.IdModulo) OVER() TotalRegistros, ROW_NUMBER() OVER(ORDER BY p.IdModulo ASC) AS RowNum, p.IdModulo, p.IdEvento, p.Nombre, p.Descripcion, p.Expositor, p.Horas FROM Modulo p WITH(NOLOCK) WHERE p.Estado=1 and p.IdEvento=@IdEvento AND ( p.Nombre LIKE ('%' + @search + '%') ) ) RECORD WHERE RECORD.RowNum>@start AND RECORD.RowNum<=@end
END

CREATE PROCEDURE [dbo].[UspListModuloByEventoPaged]
(
	@IdEvento INT,
	@search VARCHAR(20),
	@start INT,
	@length INT
)
AS

BEGIN
DECLARE @end INT;
SET @end=(@start+@length);
SELECT RECORD.* FROM ( SELECT COUNT(p.IdPersona) OVER() TotalRegistros, ROW_NUMBER() OVER(ORDER BY p.IdPersona DESC) AS RowNum, p.IdPersona, p.Nombres, p.ApellidoPaterno, p.ApellidoMaterno, p.NumeroDocumento, p.TipoOcupacion, p.DescripcionOcupacion, ocu.NombreTipo TipoOcupacionNombre, ocu.Abreviatura TipoOcupacionAbreviatura, p.CIP, p.Celular, p.Correo, p.IdProfesion, pf.Descripcion, p.IdPais, p.Ciudad FROM persona p WITH(NOLOCK) INNER JOIN Tipo ocu WITH(NOLOCK) ON p.TipoOcupacion=ocu.Valor LEFT JOIN Profesion pf WITH(NOLOCK) ON p.IdProfesion=pf.IdProfesion WHERE p.Estado=1 AND ocu.Grupo = 'OCUPACION' AND ( p.Nombres LIKE ('%' + @search + '%') OR p.ApellidoMaterno LIKE ('%' + @search + '%') OR p.ApellidoMaterno LIKE ('%' + @search + '%') OR p.NumeroDocumento LIKE ('%' + @search + '%') ) ) RECORD WHERE RECORD.RowNum>@start AND RECORD.RowNum<=@end
END

